import React ,{ Component } from 'react';
import { TopicWrapper } from '../style';

class Topic extends Component{

  render(){
    return(
      <TopicWrapper>
        <TopicItem>
        <img class="  img-blur-done" src="https://upload-images.jianshu.io/upload_images/24196296-0de67a7f2d03cf95?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240" alt="120"></img>
        </TopicItem>
      </TopicWrapper>
    )
  }

}

export default Topic;
